import React from "react"


class guesse extends React.Component
{   
    formateString(){
        let words = this.props.word.split("");
        let cachedword = [];
        for(let word of words)
        {
            cachedword.push(word === " " ? "<%spa>" : "_")
        }
        return (cachedword);
    }
    render(){
        return (
        <div>
            {this.formateString()}
        </div>
        )
    }

}

export default guesse
